import React from 'react'
import TextEn from './text_En'

export default (props) => {

	function getText(){
		return TextEn.map((texto) =>{
			{texto.text}
		})
	}

	return (
		
		<div className="Text">
			<h2>{props.title}</h2>
			<br/>
			<p>{getText()}</p>
		</div>

		)
}
